    } var findOrder = function(numCourses, prerequisites) {
    // 建图，和环检测算法相同
    const graph = buildGraph(numCourses, prerequisites);
    // 计算入度，和环检测算法相同
    const indegree = Array(numCourses).fill(0);
    for (const edge of prerequisites) {
        const from = edge[1], to = edge[0];
        indegree[to]++;
    }

    // 根据入度初始化队列中的节点，和环检测算法相同
    // @visualize bfs
    const q = [];
    for (let i = 0; i < numCourses; i++) {
        if (indegree[i] === 0) {
            // @visualize color *graph._v(i) #7ed67e
            q.push(i);
        }
    }

    // 记录拓扑排序结果
    const res = [];
    // 记录遍历节点的顺序（索引）
    let count = 0;
    // 开始执行 BFS 算法
    while (q.length > 0) {
        const cur = q.shift();
        // 弹出节点的顺序即为拓扑排序结果
        res[count++] = cur;
        for (const next of graph.neighbors(cur)) {  
            // @visualize color *graph._e(cur,next) #7ed67e
            indegree[next]--;
            if (indegree[next] === 0) {
                // @visualize color *graph._v(next) #7ed67e 
                q.push(next);
            }
            // @visualize color *graph._e(cur,next) #unset
        }
    }

    if (count !== numCourses) {
        // 存在环，拓扑排序不存在
        return [];
    }

    return res;
    // 主函数
};

// 建图函数
function buildGraph(numCourses, prerequisites) {
    // 图中共有 numCourses 个节点
    // @visualize skip
    const adjList = Array.from({ length: numCourses }, () => []);
    for (const edge of prerequisites) {
        const from = edge[1], to = edge[0];
        // 修完课程 from 才能修课程 to
        // 在图中添加一条从 from 指向 to 的有向边
        adjList[from].push(to);
    }
    return Graph.createDirectedGraphFromAdjList(adjList);
}

